import React, { useState, useEffect } from 'react';
import { Routes, Route, NavLink, useLocation } from 'react-router-dom';
import { FaVideo, FaSearch, FaList, FaUser, FaMedal } from 'react-icons/fa';
import Home from './components/Home';
import Explore from './components/Explore';
import Video from './components/Video';
import Resultat from './components/Resultat';
import Profile from './components/Profile';
import './css/App.css';
import config from './config';  // Import du fichier de configuration

const App = () => {
  const [selectedClub, setSelectedClub] = useState(config.getSelectedClub());
  const [selectedCompetition, setSelectedCompetition] = useState(config.getSelectedCompetition());
  const location = useLocation();

  useEffect(() => {
    // Mettre à jour les états locaux quand le club ou la compétition change dans config.js
    setSelectedClub(config.getSelectedClub());
    setSelectedCompetition(config.getSelectedCompetition());
  }, []);

  const handleClubSelection = (club) => {
    config.setSelectedClub(club);  // Utiliser config pour enregistrer le club
    setSelectedClub(club);
    config.setSelectedCompetition(null);  // Réinitialiser la compétition sélectionnée
    setSelectedCompetition(null);
  };

  const handleCompetitionSelection = (competitionName) => {
    config.setSelectedCompetition(competitionName);  // Utiliser config pour enregistrer la compétition
    setSelectedCompetition(competitionName);
  };

  return (
    <div className="app-container">
      <header className="app-header">
        <div className="selected-club-label">
          {selectedClub ? (
            <>
              <img src={selectedClub.logo} alt={`${selectedClub.name} logo`} className="selected-club-logo" />
              <div className="selected-club-text">
                <div className="selected-club-name">{selectedClub.name}</div>
                {selectedCompetition && (
                  <div className="selected-competition-label">{selectedCompetition}</div>
                )}
              </div>
            </>
          ) : (
            <p>No club selected</p>
          )}
        </div>
      </header>
      <div className="app-content">
        <Routes location={location}>
          <Route path="/" element={<Home selectedClub={selectedClub} />} />
          <Route
            path="/explore"
            element={
              <Explore 
                selectedClub={selectedClub} 
                selectedCompetition={selectedCompetition}
                onSelectClub={handleClubSelection} 
                onCompetitionSelected={handleCompetitionSelection} 
              />
            }
          />
          <Route path="/video" element={<Video selectedClub={selectedClub} />} />
          <Route 
            path="/resultat" 
            element={<Resultat club={selectedClub} competition={selectedCompetition} />} 
          />
          <Route path="/profile" element={<Profile />} />
        </Routes>
      </div>
      <nav className="app-navbar">
        <ul>
          <li>
            <NavLink to="/" className={({ isActive }) => (isActive ? 'active' : '')}>
              <FaVideo />
            </NavLink>
          </li>
          <li>
            <NavLink to="/resultat" className={({ isActive }) => (isActive ? 'active' : '')}>
              <FaMedal />
            </NavLink>
          </li>
          <li>
            <NavLink to="/video" className={({ isActive }) => (isActive ? 'active' : '')}>
              <FaList />
            </NavLink>
          </li>
          <li>
            <NavLink to="/explore" className={({ isActive }) => (isActive ? 'active' : '')}>
              <FaSearch />
            </NavLink>
          </li>
          <li>
            <NavLink to="/profile" className={({ isActive }) => (isActive ? 'active' : '')}>
              <FaUser />
            </NavLink>
          </li>
        </ul>
      </nav>
    </div>
  );
};

export default App;
